import React from 'react';
import PropTypes from 'prop-types'

const Form = ({onSubmit, children}: any) => {
    return (
        <form onSubmit={onSubmit}>
            {children}
        </form>
    )
}

Form.propTypes = {
    onSubmit: PropTypes.func
}

export default Form;
